script: |
  super -f text -I q9743.spq | sort > q9743.out

inputs:
  - name: q9743.spq
    data: |
      SELECT DISTINCT - ( + - col1 ) * col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 - + - col0 * - col1 - col2 NOT BETWEEN - - 69 AND - col2;
  - name: tab1

outputs:
  - name: q9743.out
    data: |
      1344
      295
      3196
